import React from "react";
import Link from "next/link";

const Nav = ({ feed }) => {
  console.log("props: " + props);
  console.log("props feed: " + feed);
  console.log("props feed title: " + feed.title);
  const { title, link, description, image } = feed;

  return (
    <nav className="text-center">
      <ul className="flex justify-between px-4 my-4 py-1">
        <li className="flex px-2 py-1">
          <Link href="/">
            <a className="text-blue-500	no-underline text-sm">Home</a>
          </Link>
        </li>

        <li className="flex px-2 py-1">
          <a target="_blank" href={link} className="text-blue-500	no-underline text-sm">
            <p>{title}</p>
            <p>{description}</p>
          </a>
        </li>

        <li className="flex px-2 py-1">
          <a target="_blank" href="https://github.com/imboss712" className="text-blue-500	no-underline text-sm">Code</a>
        </li>
      </ul>
    </nav>
  );
}

export default Nav;
